import React from "react";
import { IonContent, IonHeader, IonTitle } from "@ionic/react";

export default class LoginPage extends React.Component<{}> {
  render() {
    return (
      <IonContent slot="fixed">
        <IonHeader>
          <IonTitle>Login</IonTitle>
        </IonHeader>
      </IonContent>
    );
  }
}
